import React from 'react';
import { Link } from 'react-router-dom';    

function Navbar() {
    return (
        <nav class="navbar navbar-expand-lg bg-body-tertiary">
           <p id="navid" className="active my-auto">Home</p>
        </nav>
    );
}

export default Navbar;
